import React from 'react';
import { Grid, Image, Segment, Container, Header } from 'semantic-ui-react';
import MovieInfo from '../HeaderSegement/Explore/MovieInfo';
import vk from "../Images/vk.jpg"



const HeaderPart = () => {
    return (
        <React.Fragment>
            <Grid>
                <Grid.Row>
                    <Grid.Column>
                        <Header
                            as='h1'
                            inverted
                            style={{
                                width: '960px',
                                height: 'auto',
                                opacity: 1,
                                backgroundImage: `url(${vk})`,
                                backgroundSize: 'cover',
                                fontWeight: 'normal',
                                marginBottom: 0
                            }}
                        >
                            Hello World
                            <MovieInfo url="https://www.youtube.com/watch?v=3PK2tIyENVA&t=2s" />
                        </Header>
                    </Grid.Column>
                </Grid.Row>
            </Grid>
        </React.Fragment>
    )
}

export default HeaderPart;
